class Api {

  HttpClient _httpClient;

  Future<NetApiResult>
  getPhotos(int page) async => _getPhotosImpl(_processReal, _api_tokens.toSet(),
                                              page: page, perPage: _per_page_photos);

  Future<NetApiResult>
  _getPhotosImpl(process (Query query),  Set<String> tokens, {int page, int perPage}) async {
    NetApiResult result;
    try {
      final uri = Uri.https(_api_base_url, _path_photos, {
        'client_id': tokens.first,
        'page': page.toString(),
        'per_page': perPage.toString(),
      });
      print('getPhotos, uri: $uri, tokens: ${tokens.length} $tokens');

      final data = await process(Query(uri, page: page, perPage: perPage));
      print('getPhotos, data: $data');
      result = NetApiResult.well(data);
    } on String catch (e) {
      print('catch msg: $e');
      result = NetApiResult.bad(e);
    } on Exception catch (e, s) {
      print('catch exception: $e');
      if (s != null)
        print(s);
      result = NetApiResult.bad("An error occured.\n\n${e.toString()}", e);
    } catch (e, s) {
      print('catch error: $e');
      if (s != null)
        print(s);
      result = NetApiResult.bad("Unknown error.\n\n${e.toString()}", e);
    }

    print('result: $result');

    if (result.status == NetApiStatus.error) {
      tokens.remove(tokens.first);
      print(' process error, check available tokens, ${tokens.length} $tokens');
      if (tokens.isNotEmpty)
        return _getPhotosImpl(process, tokens, page: page, perPage: perPage);
    }

    return result;
  }

