enum NetApiStatus {
  loading,
  success,
  error
}

class Query {
  final Uri uri;

  final int page,     // elements on each page
            perPage;  // total number of elements

  const Query(this.uri, {this.page, this.perPage});
}

class Response {

  final Query query;
  final Iterable<Foto> data;
                                // rate limit is actual only for a single api token
  final int rateLimit,          // - limit of requests per hour, for ex: now it is 500 per hour in release mode, or 50 in dev mode
      rateLimitRemaining;       // - remaining limit of requests, for ex: 499, 488, ... or 50, 49, ... respectively
  final int total;              // total elements in the requested path

  const Response(this.query, this.data, {this.rateLimit, this.rateLimitRemaining, this.total});

}

abstract class NetApiResult {
  final NetApiStatus status;
  const NetApiResult(this.status);

  static well(Response response) => WellResult(response);
  static bad(String msg, [dynamic error]) => BadResult(msg, error);

  BadResult get toBad => this;
  WellResult get toWell => this;
}

class WellResult extends NetApiResult {
  final Response response;
  const WellResult(this.response) : super(NetApiStatus.success);

}
class BadResult extends NetApiResult {
  final String msg;
  final dynamic error;
  const BadResult(this.msg, [this.error]) : super(NetApiStatus.error);
}